  name: AsyncQueue<TItem>
  nameWithType: AsyncQueue<TItem>
  fullName: SuperOffice.Threading.AsyncQueue<TItem>
  type: Class
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: Async queue that can be processed by an implementation of AsyncQueueProcessor&lt;TItem&gt;
  remarks: >-
    Get instance of the queue using ClassFactory or DI. <code>ClassFactory.CreateRequired&lt;IAsyncQueue&lt;TItem&gt;&gt;()</code><br />

    This class contains both a <b>queue</b> and a mechanism to <b>process</b> items in the queue. Processing

    is done by calling the <xref href="SuperOffice.Threading.AsyncQueue%601.ProcessNextItemAsync(SuperOffice.Threading.AsyncQueueProcessItemAsync%7b%600%7d%2cSystem.Threading.CancellationToken)" data-throw-if-not-resolved="false"></xref> method,

    for instance from a BackgroundService that uses <xref href="SuperOffice.Threading.AsyncQueueProcessor%602" data-throw-if-not-resolved="false"></xref> as its base class.

    Our own <xref href="SuperOffice.Threading.AsyncQueueBase%601" data-throw-if-not-resolved="false"></xref> class contains the <xref href="SuperOffice.Threading.AsyncQueueBase%601.ProcessItemsAsync(SuperOffice.Threading.AsyncQueueProcessItemAsync%7b%600%7d%2cSystem.Threading.CancellationToken)" data-throw-if-not-resolved="false"></xref> method (note plural form of Items in its name!). This is the

    method that contains the loop, which repeatedly calls our ProcessNextItemAsync method. This loop should only terminate

    throught the CancellationToken it was set up with.
