- uid: SuperOffice.Threading.AsyncQueue`1.ProcessNextItemAsync(SuperOffice.Threading.AsyncQueueProcessItemAsync{`0},System.Threading.CancellationToken)
  commentId: M:SuperOffice.Threading.AsyncQueue`1.ProcessNextItemAsync(SuperOffice.Threading.AsyncQueueProcessItemAsync{`0},System.Threading.CancellationToken)
  id: ProcessNextItemAsync(SuperOffice.Threading.AsyncQueueProcessItemAsync{`0},System.Threading.CancellationToken)
  parent: SuperOffice.Threading.AsyncQueue`1
  langs:
  - csharp
  - vb
  name: ProcessNextItemAsync(AsyncQueueProcessItemAsync<TItem>, CancellationToken)
  nameWithType: AsyncQueue<TItem>.ProcessNextItemAsync(AsyncQueueProcessItemAsync<TItem>, CancellationToken)
  fullName: SuperOffice.Threading.AsyncQueue<TItem>.ProcessNextItemAsync(SuperOffice.Threading.AsyncQueueProcessItemAsync<TItem>, System.Threading.CancellationToken)
  type: Method
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: >-
    Block until an item can be picked off the queue, or the cancellation token is signaled.

    Pick the top item off the queue and call the <b>processor</b> delegate. <br />

    Multiple calls (from separate Tasks) to this method are supported and will run in parallel

    if there are multiple items in the queue.
  remarks: >-
    This method contains the mechanisms needed to safely pick items off the queue, or block until an

    item is available (in an async-friendly manner). <br />

    _itemsBeingProcessed contains the currently processing items. This is for information only.
  example: []
  syntax:
    content: public override Task ProcessNextItemAsync(AsyncQueueProcessItemAsync<TItem> processor, CancellationToken cancellationToken)
    parameters:
    - id: processor
      type: SuperOffice.Threading.AsyncQueueProcessItemAsync{{TItem}}
      description: The concrete method to be called for an item, when an item becomes available
    - id: cancellationToken
      type: System.Threading.CancellationToken
      description: ''
    return:
      type: System.Threading.Tasks.Task
      description: ''
    content.vb: Public Overrides Function ProcessNextItemAsync(processor As AsyncQueueProcessItemAsync(Of TItem), cancellationToken As CancellationToken) As Task
